import React from "react";
import Main from "./Main";
import { Switch, Route } from "react-router-dom";
import Profile from "./profile/Profile";


const Home = (props) => {
  return (
      <div className="">
        <Switch>
          <Route exact path="/account" component={Profile} />
          <Route path="" component={Main} />
        </Switch>
      </div>
  );
};

export default Home;
